import React from 'react';
import './App.css';
import Particles from "react-particles-js";


const particleOpt ={
  "fps_limit": 28,
  "particles": {
      "number": {
          "value": 200,
          "density": {
              "enable": false
          }
      },
      "line_linked": {
          "enable": true,
          "distance": 30,
          "opacity": 0.4
      },
      "move": {
          "speed": 1
      },
      "opacity": {
          "anim": {
              "enable": true,
              "opacity_min": 0.05,
              "speed": 2,
              "sync": false
          },
          "value": 0.4
      }
  },
  "polygon": {
      "enable": true,
      "scale": 0.5,
      "type": "inline",
      "move": {
          "radius": 10
      },
      "url": "../../public/UNADJUSTEDNONRAW_mini_19.jpg",
      "inline": {
          "arrangement": "equidistant"
      },
      "draw": {
          "enable": true,
          "stroke": {
              "color": "rgba(255, 255, 255, .2)"
          }
      }
  },
  "retina_detect": false,
  "interactivity": {
      "events": {
          "onhover": {
              "enable": true,
              "mode": "bubble"
          }
      },
      "modes": {
          "bubble": {
              "size": 6,
              "distance": 40
          }
      }
  }
}
function App() {
  return (
    <div className="App">
      <Particles    
          params= {particleOpt} 
      />
      <h1>Maris-Angelique</h1>
      <h3>Full Stack Web Developer</h3>
    </div>
  );
}

export default App;
